import React, { Component } from 'react'

export default class Fetchme extends Component {
    constructor(props) {
        super(props);
        this.state = {
          data: null,
          statebus: []
        };
    }
    componentDidMount() {
        fetch('https://www.redbus.in/Home/SolarSearch?search=c')
          .then(response => response.json())
          .then(parsedJSON => {
            let buses = parsedJSON.response.docs.map((redbus)=>{
              return(
              <div>{redbus.name}</div>
              )
            })
            this.setState({statebus:buses})
          })

      }

    render() {

        return (
            <ul>
        {this.state.statebus}
      </ul>
        );
    }
}
